import { Component } from '@angular/core';

@Component({
  selector: 'app-padre',
  templateUrl: './padre.component.html',
  styleUrls: ['./padre.component.css']
})

export class PadreComponent {
  nombrePadre:string = 'Pablo';
  apPaternoPadre:string = 'Vargas';
  apMaternoPadre:string = 'Morales';
}
<div>
  <h1>Datos del PADRE</h1>
  <span>Nombre:</span><label>{{ nombrePadre }}</label>label><br/>
  <span>Apellido Paterno:</span><label>{{ apPaternoPadre }}</label><br/>
  <span>Apellido Materno:</span><label>{{ apMaternoPadre }}</label><br/>
</div>



